import './App.css';
import { motion } from "framer-motion"
import { BsFillArrowLeftCircleFill } from "react-icons/bs";

function Nav() {
  return (
    <div className="right-sidebar">
      <ul>
        <li>Item 1</li>
        <li>Item 2</li>
        <li>Item 3</li>
      </ul>
    </div>
  );

}

function App() {

  return (
<div className='nav'>
    <motion.btn animate={{x:100}} class="menubtn" onClick={Nav}>

      <BsFillArrowLeftCircleFill className='menuicon'/>

    </motion.btn>
</div>
  );
}


export default App;
